import React from 'react';
import './Post.css';

export default function Post(props) {

  const posts = props.posts;

  return (
    <div className="post">
      {posts.map((obj) => {
        return <div>
          <h2>{`The author name is: ${obj.name}`}</h2>
          <p>{`The story is: ${obj.body}`}</p>
        </div>
      })};
    </div>
  );
}
